class Header extends Component {
    render() {
        return (

            <header>
<center></center>
<p style={{fontFamily: 'monospace', fontSize:'90px', height:'50px'}}>Tas Ali</p>


<div class="menu" style={{borderWidth: '0.9px', borderSize: '3px', borderRadius: '3px', borderStyle:'dashed', borderColor: 'white', fontSize:'15px' }}>
    <ul> 
        <li style={{   color:'white', display: 'inline', marginLeft: '3px' }}><a href='/'> Home </a></li>
        <li style={{   color:'white', display: 'inline', marginLeft: '3px' }}><a href='/'> Archive </a></li>
        <li style={{   color:'white', display: 'inline', marginLeft: '3px' }}><a href='/'> Whoami </a></li>
    </ul>
</div>

</header>

        );
    }
}








export default Header;
